[Form]
public class VendRFQJournal extends FormRun implements OfficeIGeneratedWorkbookCustomExporter, OfficeIMenuCustomizer
{
    const str ExportHeaderLinesToExcelOptionId = 'HeaderLinesCustom';

    InventDimCtrl_Frm           inventDimFormSetup;
    PurchRFQCaseId              rfqCaseId;
    PurchRFQId                  rfqId;
    PurchInternalRFQId          internalRfqId;
    TransDate                   rfqDate;
    boolean                     isCallerDataEntity;

}

public void customizeMenuOptions(OfficeMenuOptions _menuOptions)
{
    List exportOptions = _menuOptions.customMenuItems();

    var exportOption = OfficeGeneratedExportMenuItem::construct(tableStr(VendRequestForQuotationJournalHeaderEntity), ExportHeaderLinesToExcelOptionId);
    exportOption.displayName("@SCM:RequestForQuotationHeaderAndLines");
    exportOptions.addEnd(exportOption);
}

public ExportToExcelDataEntityContext getDataEntityContext(OfficeGeneratedExportMenuItem _menuItem)
{
    ExportToExcelDataEntityContext context = null;

    switch (_menuItem.id())
    {
        case ExportHeaderLinesToExcelOptionId:
            context = ExportToExcelDataEntityContext::constructDefault(tableStr(VendRequestForQuotationJournalHeaderEntity));

            var headerEntityInfo = context.findEntityByName(tableStr(VendRequestForQuotationJournalHeaderEntity));

            var headerFilterBuilder = new ExportToExcelFilterTreeBuilder(tablestr(VendRequestForQuotationJournalHeaderEntity));
            var journalHeaderRFQNumberFilter = headerFilterBuilder.areEqual(fieldStr(VendRequestForQuotationJournalHeaderEntity, RFQNumber), VendRFQJour.RFQId);
            var journalHeaderRFQJournalDateFilter = headerFilterBuilder.areEqual(fieldStr(VendRequestForQuotationJournalHeaderEntity, RFQJournalDate), VendRFQJour.RFQDate);
            var journalHeaderInternalRFQIdFilter = headerFilterBuilder.areEqual(fieldStr(VendRequestForQuotationJournalHeaderEntity, InternalRFQJournalNumber), VendRFQJour.InternalRFQId);

            var combinedFilterExpression = headerFilterBuilder.and(headerFilterBuilder.companyFilter(),
                                                        headerFilterBuilder.and(journalHeaderRFQNumberFilter,
                                                        headerFilterBuilder.and(journalHeaderRFQJournalDateFilter, journalHeaderInternalRFQIdFilter)));

            headerEntityInfo.filter(combinedFilterExpression);

            var lineEntityInfo = context.addEntityDefault(tableStr(VendRequestForQuotationJournalLineEntity));

            var lineFilterBuilder = new ExportToExcelFilterTreeBuilder(tablestr(VendRequestForQuotationJournalLineEntity));
            var journalLineRFQNumberFilter = lineFilterBuilder.areEqual(fieldStr(VendRequestForQuotationJournalLineEntity, RFQNumber), VendRFQTrans.RFQId);
            var journalLineRFQJournalDateFilter = lineFilterBuilder.areEqual(fieldStr(VendRequestForQuotationJournalLineEntity, RFQJournalDate), VendRFQTrans.RFQDate);
            var journalLineInternalRFQIdFilter = lineFilterBuilder.areEqual(fieldStr(VendRequestForQuotationJournalLineEntity, InternalRFQJournalNumber), VendRFQTrans.InternalRFQId);

            combinedFilterExpression = lineFilterBuilder.and(lineFilterBuilder.companyFilter(),
                                                        lineFilterBuilder.and(journalLineRFQNumberFilter,
                                                        lineFilterBuilder.and(journalLineRFQJournalDateFilter, journalLineInternalRFQIdFilter)));
            lineEntityInfo.filter(combinedFilterExpression);
            break;
    }

    return context;
}

/// <summary>
/// Returns the <c>VendRFQTrans</c> table buffer.
/// </summary>
/// <returns>
/// The <c>VendRFQTrans</c> table buffer.
/// </returns>
public Common docCursor()
{
    Common docCursor;

    docCursor = super();

    if (docCursor.TableId == tableNum(InventDim))
    {
        docCursor = vendRFQTrans;
    }

    return docCursor;
}

/// <summary>
/// Initializes the form, and updates the design.
/// </summary>
public void init()
{
    Args args = element.args();

    if (args.caller())
    {
        Common rec = args.record();
        switch(rec.TableId)
        {
            case tableNum(PurchRFQTmpCompareRFQReply):
                PurchRFQTmpCompareRFQReply purchRFQTmpCompareRFQReply = rec;
                rfqCaseId =  PurchRFQTable::find(purchRFQTmpCompareRFQReply.RFQId).rfqCaseId;
                break;

            case tableNum(VendRequestForQuotationJournalHeaderStaging):
                VendRequestForQuotationJournalHeaderStaging headerStaging = rec;
                rfqId = headerStaging.RfqNumber;
                rfqDate = headerStaging.RFQJournalDate;
                internalRfqId = headerStaging.InternalRFQJournalNumber;
                isCallerDataEntity = true;
                break;

            case tableNum(VendRequestForQuotationJournalLineStaging):
                VendRequestForQuotationJournalLineStaging lineStaging = rec;
                rfqId = lineStaging.RfqNumber;
                rfqDate = lineStaging.RFQJournalDate;
                internalRfqId = lineStaging.InternalRFQJournalNumber;
                isCallerDataEntity = true;
                break;
        }
    }

    super();
    element.updateDesign(InventDimFormDesignUpdate::Init);

    if (TaxSolutionScopeIntegrationUtil::isCompanyEnabled())
    {
        TaxDocumentLauncher.visible(true);
        ButtonTaxJournalTrans.visible(false);
    }
}

