    super();
    element.setButtonAccessHeader();
    element.setButtonAccessLine();
}

/// <summary>
/// Enables, or disables buttons in the action bar.
/// </summary>
void setButtonAccessHeader()
{
    buttonTaxJournalTrans.enabled(vendRFQJour.RecId);
    buttonMarkupTrans_HeadingPurch.enabled(vendRFQJour.RecId);

    //"Received" journals are only present for the sake of overview, they are not associated with any reports.
    boolean enableReportView = vendRFQJour.RecId && VendRFQJour.RFQUpdateType != PurchRFQUpdateType::Received;
    buttonPurchRFQShow.enabled(enableReportView);
}

/// <summary>
/// Enables, or disables the line buttons.
/// </summary>
void setButtonAccessLine()
{
    buttonMarkupTrans_LinePurch.enabled(vendRFQTrans.RecId ? true : false);
    menuButtonInventory.enabled(vendRFQTrans.RecId ? true : false);
}

/// <summary>
/// Updates the design for the inventory dimension fields.
/// </summary>
/// <param name="mode">
/// An enum, to indicate if the dimensions are to be initialized, or to be refreshed.
/// </param>
/// <exception cref="Exception::Error">
/// Throws "Incorrect parameter for the function updateDesign", if the the mode value is neither "Initialize" nor "Active".
/// </exception>
void updateDesign(InventDimFormDesignUpdate mode)
{
    switch (mode)
    {
        case InventDimFormDesignUpdate::Init :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_PurchRFQ::newFromForm(element);
            }

        case InventDimFormDesignUpdate::Active :
            inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(vendRFQTrans.ItemId));
            inventDimFormSetup.formSetControls(true);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

public void init()
{
    QueryBuildDataSource qbds;

    super();

    qbds = this.query().dataSourceTable(tableNum(VendRFQJour));

    if (rfqCaseId)
    {
        qbds.addRange(fieldNum(VendRFQJour,rfqCaseId)).value(queryValue(rfqCaseId));
    }
    else if (isCallerDataEntity)
    {
        qbds.addRange(fieldNum(VendRFQJour, rfqId)).value(queryValue(rfqId));
        qbds.addRange(fieldNum(VendRFQJour, InternalRFQId)).value(queryValue(internalRfqId));
        qbds.addRange(fieldNum(VendRFQJour, rfqDate)).value(queryValue(rfqDate));
    }
}

/// <summary>
/// Calls the <c>setButtonAccessHeader</c> method, to set the action pane buttons.
/// </summary>
/// <returns>
/// An integer, to indicate if the current record is set.
/// </returns>
public int active()
{
    int ret;

    if (TaxSolutionScopeIntegrationUtil::isCompanyEnabled())
    {
        if (VendRFQJour.RecId)
        {
            TaxableDocumentDescriptorPurchaseRFQParm taxableDocumentDescriptorPurchaseRFQParm = TaxableDocumentDescriptor::getTaxDocumentdescriptor(
                className2Id(classStr(TaxableDocumentDescriptorPurchaseRFQParm)),
                VendRFQJour);

            TaxDocumentLauncher.enabled(taxableDocumentDescriptorPurchaseRFQParm.shouldPersistTaxDocument());
        }
        else
        {
            TaxDocumentLauncher.visible(true);
        }
    }

    ret = super();

    element.setButtonAccessHeader();

    return ret;
}

/// <summary>
/// Calls the <c>setButtonAccessHeader</c> method, to set the line buttons.
/// </summary>
/// <returns>
/// An integer, to indicate if the current record is set.
/// </returns>
public int active()
{
    int ret;

    ret = super();

    element.setButtonAccessLine();

    return ret;
}

